// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

library RLPDecoder {

  struct RLPItem {
      bytes data;
      uint length;
  }

  uint constant LIST_LENGTH = 20;

  //Nested Lists are not supported. 
  function decodeList(bytes calldata input) internal pure returns (bytes[] memory) {

    bytes1 firstByte = input[0];
    bytes memory innerRemainder;
    uint length = 0;
    if (firstByte <= hex"f7") {
      length = uint8(firstByte) - uint8(bytes1(hex"bf"));
      innerRemainder = slice(input, 1, length - 1);
    } else {
      // a list  over 55 bytes long
      uint llength = uint8(firstByte) - uint8(bytes1(hex"f6"));
      length = toUintX(slice(input, 1, llength), 0);
      uint totalLength = llength + length;
      innerRemainder = slice(input, llength, totalLength - 1);
      require(innerRemainder.length != 0);

    }
    uint listLength = 0;
    bytes[] memory decoded;
    uint index = 0;
    RLPItem memory result;
    while (innerRemainder.length > 0) {
      if(index == decoded.length) {
        bytes[] memory tmp = decoded;
        listLength += LIST_LENGTH;
        decoded = new bytes[](listLength);
        if(tmp.length != 0) {
          for(uint i = 0; i < tmp.length; i++ ){
            decoded[i] = tmp[i];
          }
        }
      }

      result = decodeBytes(innerRemainder);
      innerRemainder = slice(innerRemainder, result.length, innerRemainder.length - result.length - 1);
      decoded[index] = result.data;
      index++;
    }

    bytes[] memory decodedList = new bytes[](index);
    for(uint i = 0; i < index; i++ ){
        decodedList[i] = decoded[i];
    }

    return decodedList;


  }

  function decodeBytes(bytes memory input) internal pure returns (RLPItem memory item) {
    bytes1 firstByte = input[0];
    if (firstByte <= hex"7f") {
      return RLPItem(bytes(slice(input, 0,1)), 1);
    }
    else if (firstByte <= hex"b7") {
      uint length = uint8(firstByte) - uint8(bytes1(hex"7f"));
      bytes memory data;
      if (firstByte == hex"80") {
          data = bytes("");
          item = RLPItem(data, 1);
      }
      else { 
          data = bytes(slice(input, 1, length - 1));
          item = RLPItem(data, length);
      }
      require(length != 2 || data[0] > hex"80");
      //return data;
      return item;
    }
    else if (firstByte <= hex"bf") {
      // string is greater than 55 bytes long. A single byte with the value (0xb7 plus the length of the length),
      // followed by the length, followed by the string
      uint llength = uint8(firstByte) - uint8(bytes1(hex"b6"));
      require(input.length - 1 > llength);
      uint length = toUintX(slice(input, 1, llength - 1), 0);
      require(length > 55);
      item = RLPItem(slice(input, llength, length + llength - 1), length + 2);
      return item;
    }

  }

  //function test(bytes calldata input) public pure returns (RLPItem memory) {
  function test(bytes calldata input) public pure returns (uint) {
      bytes1 firstByte = input[0];
      uint llength = uint8(firstByte) - uint8(bytes1(hex"b6"));
      return llength;
      /*require(input.length - 1 > llength);
      uint length = toUintX(slice(input, 1, llength - 1), 0);
      require(length > 55);
      item = RLPItem(slice(input, llength, length + llength - 1), length + 2);
      return item;*/

  }

  function decode(bytes calldata input) public pure returns (bytes[] memory) {
    bytes1 firstByte = input[0];
    if (firstByte > hex"bf") {
        return decodeList(input);
    } else  {
        bytes[] memory data = new bytes[](1);
        data[0] = decodeBytes(input).data;
        return data;
    }

  }

  //Temporarily the length is uint8 only.
  function toUintX(bytes memory _bytes, uint256 _start) internal pure returns (uint) {
      return toUint8(_bytes, _start);
  }

  function toUint8(bytes memory _bytes, uint256 _start) internal pure returns (uint8) {
      require(_bytes.length >= _start + 1 , "toUint8_outOfBounds");
      uint8 tempUint;

      assembly {
          tempUint := mload(add(add(_bytes, 0x1), _start))
      }

      return tempUint;
  }

    function slice(
        bytes memory _bytes,
        uint256 _start,
        uint256 _length
    )
        internal
        pure
        returns (bytes memory)
    {
        require(_length + 31 >= _length, "slice_overflow");
        require(_bytes.length >= _start + _length, "slice_outOfBounds");

        bytes memory tempBytes;

        assembly {
            switch iszero(_length)
            case 0 {
                // Get a location of some free memory and store it in tempBytes as
                // Solidity does for memory variables.
                tempBytes := mload(0x40)

                // The first word of the slice result is potentially a partial
                // word read from the original array. To read it, we calculate
                // the length of that partial word and start copying that many
                // bytes into the array. The first word we copy will start with
                // data we don't care about, but the last `lengthmod` bytes will
                // land at the beginning of the contents of the new array. When
                // we're done copying, we overwrite the full first word with
                // the actual length of the slice.
                let lengthmod := and(_length, 31)

                // The multiplication in the next line is necessary
                // because when slicing multiples of 32 bytes (lengthmod == 0)
                // the following copy loop was copying the origin's length
                // and then ending prematurely not copying everything it should.
                let mc := add(add(tempBytes, lengthmod), mul(0x20, iszero(lengthmod)))
                let end := add(mc, _length)

                for {
                    // The multiplication in the next line has the same exact purpose
                    // as the one above.
                    let cc := add(add(add(_bytes, lengthmod), mul(0x20, iszero(lengthmod))), _start)
                } lt(mc, end) {
                    mc := add(mc, 0x20)
                    cc := add(cc, 0x20)
                } {
                    mstore(mc, mload(cc))
                }

                mstore(tempBytes, _length)

                //update free-memory pointer
                //allocating the array padded to 32 bytes like the compiler does now
                mstore(0x40, and(add(mc, 31), not(31)))
            }
            //if we want a zero-length slice let's just return a zero-length array
            default {
                tempBytes := mload(0x40)
                //zero out the 32 bytes slice we are about to return
                //we need to do it because Solidity does not garbage collect
                mstore(tempBytes, 0)

                mstore(0x40, add(tempBytes, 0x20))
            }
        }

        return tempBytes;
    }

}
